import style from '../static/Style';
import React,  { Component } from 'react';
import { Card, CardActionArea, CardContent, Typography, CardMedia } from '@material-ui/core';


class Top extends Component {
  constructor(props) {
    super(props);
  }
  render(){
    return(
      <div>
        <p>学習中の教材</p>
        <Card style={{width: "200px"}}>
          <CardActionArea>
            <CardContent>
              <CardMedia
                component="img"
                alt="Contemplative Reptile"
                height="140"
                image="/static/images/text.jpg"
                title="Contemplative Reptile"
              />
              <Typography gutterBottom variant="h5" component="p">
                ターゲット英熟語
              </Typography>
              <Typography variant="body2" color="textSecondary" component="p">
                1000個の英熟語が収録されています。受験生の間で差がつくのが英熟語です。目標二周はしましょう。
              </Typography>
            </CardContent>
          </CardActionArea>
        </Card>
        <div className="learning-textbook-wrapper">
          <div className="learning-textbook-container">
          </div>
        </div>
      </div>
    );}
}

export default Top;
